script: |
  super -f tsv -I q7358.sql | sort > q7358.out

inputs:
  - name: q7358.sql
    data: |
      SELECT DISTINCT - COUNT ( * ) / - MAX ( DISTINCT - col0 ) + - 97 FROM tab1 AS cor0 WHERE NOT + col1 * col2 BETWEEN CAST ( + ( - + col1 ) AS INTEGER ) * + col1 + + ( + - col2 ) * - col1 AND - + col0 + col0;
  - name: tab1

outputs:
  - name: q7358.out
    data: |
      -97
